import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faCalendarAlt, faClock, faMapMarkerAlt, faMapMarkedAlt, faHotel, faQuestionCircle } from '@fortawesome/free-solid-svg-icons'

export const details = [
    {
        icon: <FontAwesomeIcon icon={faCalendarAlt} color="goldenrod" />,
        key: "Date",
        children: false,
        value: <div>Saturday, July 16th, 2022</div>
    },
    {
        icon: <FontAwesomeIcon icon={faClock} color="goldenrod" />,
        key: "Time",
        children: false,
        value: <div>Ceremony to begin at 5:00 PM. <br /> Reception to immediately follow.</div>
    },
    {
        icon: <FontAwesomeIcon icon={faMapMarkerAlt} color="goldenrod" />,
        key: "Venue",
        children: false,
        value: <a href="https://www.wintergardenbymonroes.com/" target="_blank" rel="noreferrer">The Wintergarden by Monroe's</a>
    },
    {
        icon: <FontAwesomeIcon icon={faMapMarkedAlt} color="goldenrod" />,
        key: "Address",
        children: false,
        value: <a href="https://goo.gl/maps/7aAkLpRBmMaoSgVq6" target="_blank" rel="noreferrer">1 Bausch and Lomb Pl, Rochester, NY 14604</a>
    },
    {
        icon: <FontAwesomeIcon icon={faHotel} color="goldenrod" />,
        key: "Hotel Information",
        children: true,
        value: [
            {
                key: "Blocked Hotels",
                value: ["Hotel 1", "Hotel 2"]
            },
            {
                key: "Shuttle",
                value: ["Shuttle 1", "Shuttle 2"]
            },
            {
                key: "Parking",
                value: ["Parking Garage", "Street Parking"]
            },
        ]
    },
    {
        icon: <FontAwesomeIcon icon={faQuestionCircle} color="goldenrod" />,
        key: "Questions",
        value: <div style={{ wordBreak: "break-word" }}>
            <a href="mailto:igorradmilovic23@gmail.com?subject=Wedding Question">
                igorradmilovic23@gmail.com
            </a>
            <div>or</div>
            <a href="mailto:nicolebingo@gmail.com?subject=Wedding Question">
                nicolebingo@gmail.com
            </a>

        </div >
    }
]
